//Styles
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Tela from "../Tela.css"
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from "react-bootstrap/Form";
import React, { useContext, useEffect, useState } from 'react';


import Logo from "../imagens/quest_logo.png"

export default function Modal_Senha(props) {
    const [modalShow, setModalShow] = React.useState(false);
    //const [password1, setPassword1] = useState(1);



  return (
    <div className="font_t">
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
      </Modal.Header>
      <Modal.Body>
        <h4 className="ms-5 ps-5">Redefinir a Senha</h4>
        <Form.Group className="mb-2">
                    <Form.Label htmlFor="password1" className="font-t pt-2">Senha atual</Form.Label>
                    <Form.Control 
                    type="password" 
                    placeholder="" 
                    name = "password1"
                    id="passaword" 
                    onChange={props.password}
                    />
                    </Form.Group>
                    <Form.Group className="mb-2">
                    <Form.Label htmlFor="password1" className=" pt-2">Nova senha</Form.Label>
                    <Form.Control 
                    type="password" 
                    placeholder="● ● ● ● ● ● ● ●" 
                    name = "password1"
                    id="nova_passaword" 
                    onChange={props.password}
                    />
                    </Form.Group>
                    <Form.Group className="mb-2">
                    <Form.Label htmlFor="password1" className="text-muted pt-2">Confirme a senha</Form.Label>
                    <Form.Control 
                    type="password" 
                    placeholder="● ● ● ● ● ● ● ●" 
                    name = "password1"
                    id="nova_passaword" 
                    onChange={props.password}
                    />
                    </Form.Group>
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={props.onHide} className="botao">SALVAR ALTERAÇÕES</Button>
      </Modal.Footer>
    </Modal>
    </div>
  );
}
